INSERT INTO links (id, parent_id, category, category_order, "group", group_order, title, link, public, description, date, authorship_organisation, authorship_name, authorship_mail, logo, search, search_title) VALUES (311, 311, 'geoservice', 5, 'WFS', 7, 'Behörden (nicht-kommunal) in der Hanse- und Universitätsstadt Rostock', 'https://geo.sv.rostock.de/geodienste/behoerden_nicht_kommunal/wfs', true, 'Diese Daten umfassen die Standorte der nicht-kommunalen Behörden in der Hanse- und Universitätsstadt Rostock mit Informationen zu Adresse, Bezeichnung, Verwaltungsebene, Barrierefreiheit, Sprechzeiten und Kontaktdaten.', '2020-09-28', '{"Hanse- und Universitätsstadt Rostock – Kataster-, Vermessungs- und Liegenschaftsamt"}', '{"Silke Kroszewski"}', '{silke.kroszewski@rostock.de}', NULL, true, NULL);
INSERT INTO links (id, parent_id, category, category_order, "group", group_order, title, link, public, description, date, authorship_organisation, authorship_name, authorship_mail, logo, search, search_title) VALUES (961, 446, 'geoservice', 5, 'SOS', 4, 'Radmonitore in der Hanse- und Universitätsstadt Rostock', 'https://geo.sv.rostock.de/geodienste/radmonitore/sos', true, 'Diese Daten umfassen die Standorte der Radmonitore in der Hanse- und Universitätsstadt Rostock mit Informationen zu ID, Bezeichnung, Summe der Radfahrer am letzten Messtag, Gesamtsumme der Radfahrer seit Messbeginn, täglicher Summe der Radfahrer seit Messbeginn im Schnitt und Website.', '2020-10-23', '{"Hanse- und Universitätsstadt Rostock – Amt für Mobilität"}', '{"Steffen Nozon"}', '{steffen.nozon@rostock.de}', NULL, true, NULL);
INSERT INTO links (id, parent_id, category, category_order, "group", group_order, title, link, public, description, date, authorship_organisation, authorship_name, authorship_mail, logo, search, search_title) VALUES (1005, 1003, 'geoservice', 5, 'WMS', 8, 'Vorprüfungen der Hanse- und Universitätsstadt Rostock zur Feststellung der UVP-Pflicht gemäß UVPG und LUVPG M-V', 'https://geo.sv.rostock.de/geodienste/uvp_vorpruefungen/wms', false, 'Diese Karte umfasst die Vorprüfungen der Hanse- und Universitätsstadt Rostock zur Feststellung der Pflicht zur Umweltverträglichkeitsprüfung (UVP-Pflicht) gemäß Gesetz über die Umweltverträglichkeitsprüfung (UVPG) und Gesetz über die Umweltverträglichkeitsprüfung in Mecklenburg-Vorpommern (LUVPG M-V) mit Informationen zu Bezeichnung des Vorhabens, Vorgangsart des Vorhabens, Genehmigungsbehörde des Vorhabens, Datum des Posteingangs bei der Genehmigungsbehörde des Vorhabens, Registriernummer des Bauamtes des Vorhabens, Aktenzeichen des Vorhabens, Rechtsgrundlage des Vorhabens, Typ des Vorhabens, Art, Datum des Posteingangs, Datum, Ergebnis, Datum Bekanntmachung „Städtischer Anzeiger“, Datum Veröffentlichung UVP-Portal und Prüfprotokoll. Umweltprüfungen im Rahmen der Bauleitplanung sind dabei nicht enthalten. Diese werden durch die Umweltberichte im Rahmen der rechtskräftigen Bebauungspläne (B-Pläne) der Hanse- und Universitätsstadt Rostock gemäß §§ 34 und 35 Baugesetzbuch (BauGB) dokumentiert. Die Ergebnisse der Vorprüfungen werden im „Städtischen Anzeiger“ öffentlich bekannt gemacht und seit 2019 auch über das UVP-Portal des Landes Mecklenburg-Vorpommern: https://www.uvp-verbund.de.', '2020-10-02', '{"Hanse- und Universitätsstadt Rostock – Amt für Umwelt- und Klimaschutz"}', '{"Jacqueline Sambale"}', '{jacqueline.sambale@rostock.de}', NULL, false, NULL);
