INSERT INTO links (id, parent_id, category, category_order, "group", group_order, title, link, public, description, date, authorship_organisation, authorship_name, authorship_mail, logo, search, search_title) VALUES (964, 962, 'geoservice', 5, 'SOS', 4, 'Luftmessstationen in der Hanse- und Universitätsstadt Rostock', 'https://geo.sv.rostock.de/geodienste/luftmessstationen/sos', false, 'Diese Daten umfassen die Standorte der Luftmessstationen des Landesamtes für Umwelt, Naturschutz und Geologie Mecklenburg-Vorpommern (LUNG M-V) in der Hanse- und Universitätsstadt Rostock mit Informationen zu ID, Bezeichnung, Stationscharakteristik, Datum des Messbeginns, Höhe der Gasprobenahme über Grund in der Einheit Meter, Messzeitpunkt (Beginn der Stunde), gemessener Komponente, Messwert – aktueller, auf eine Stunde gemittelter, jedoch weder validierter noch korrigierter Messwert – in der entsprechenden Einheit und Website.', '2020-10-23', '{"Landesamt für Umwelt, Naturschutz und Geologie Mecklenburg-Vorpommern"}', '{"Dr. Thomas Draheim"}', '{thomas.draheim@lung.mv-regierung.de}', NULL, false, NULL);
