INSERT INTO links (id, parent_id, category, category_order, "group", group_order, title, link, public, description, date, authorship_organisation, authorship_name, authorship_mail, logo, search, search_title) VALUES (487, 487, 'geoservice', 5, 'WFS', 7, 'Toiletten in der Hanse- und Universitätsstadt Rostock', 'https://geo.sv.rostock.de/geodienste/toiletten/wfs', true, 'Diese Daten umfassen die Standorte der Toiletten in der Hanse- und Universitätsstadt Rostock mit Informationen zu Art, Bewirtschafter, Behindertengerechtigkeit, Duschmöglichkeit, Wickelmöglichkeit und Öffnungszeiten.', '2020-08-20', '{"Hanse- und Universitätsstadt Rostock – Kataster-, Vermessungs- und Liegenschaftsamt","Hanse- und Universitätsstadt Rostock – Amt für Umwelt- und Klimaschutz"}', '{"Silke Kroszewski","Axel Pohl"}', '{silke.kroszewski@rostock.de,axel.pohl@rostock.de}', NULL, true, NULL);
INSERT INTO links (id, parent_id, category, category_order, "group", group_order, title, link, public, description, date, authorship_organisation, authorship_name, authorship_mail, logo, search, search_title) VALUES (1016, 1016, 'geoservice', 5, 'WFS', 7, 'Luftqualität der Hanse- und Universitätsstadt Rostock', 'https://geo.sv.rostock.de/geodienste/luftqualitaet/wfs', true, 'Diese Daten umfassen Daten zur Luftqualität der Hanse- und Universitätsstadt Rostock. Gezeigt werden Jahresmittelwerte der Immissionsbelastung der Luftschadstoffkomponenten Stickstoffdioxid, Feinstaub und Schwefeldioxid. Eingegangen sind die Emissionen aus genehmigungsbedürftigen Anlagen sowie dem Schiffs- und Straßenverkehr inklusive der Hintergrundbelastung. Die Emissionen wurden im Strömungsfeld der Klimaanalyse, das hierfür auf eine jahresmittlere Ausbreitungssituation erweitert wurde, verdriftet. Hinweis: Die Schadstoffbelastung wird im Rahmen der eingesetzten Methodik hauptsächlich durch die Emissionsmenge und die modellierte Strömung bestimmt. Da hierbei anders als bei der Klimaanalyse keine autochthonen Wetterlage sondern eine jahresdurchschnittliche Ausbreitungssituation im Vordergrund steht, sind die Ergebnisse nur in gewissen Grenzen dazu geeignet, grenzwertrelevante Aussagen im Sinne der 39. BImSchV zu treffen. Rasterauflösung: 20 m.', '2020-08-18', '{"GEO-NET Umweltconsulting GmbH","GEO-NET Umweltconsulting GmbH"}', '{"Peter Trute","Harald Kuttig"}', '{trute@geo-net.de,kuttig@geo-net.de}', NULL, true, NULL);
INSERT INTO links (id, parent_id, category, category_order, "group", group_order, title, link, public, description, date, authorship_organisation, authorship_name, authorship_mail, logo, search, search_title) VALUES (612, 363, 'geoservice', 5, 'WMS', 8, 'Gebäude in der Hanse- und Universitätsstadt Rostock', 'https://geo.sv.rostock.de/geodienste/gebaeude/wms', true, 'Diese Karte umfasst die Gebäude in der Hanse- und Universitätsstadt Rostock mit Informationen zu Art, Bezeichnung, Lage zur Erdoberfläche, Grundfläche in der Einheit Quadratmeter, Anzahl der Vollgeschosse und Baujahr.', '2020-10-23', '{"Hanse- und Universitätsstadt Rostock – Kataster-, Vermessungs- und Liegenschaftsamt","Landkreis Ludwigslust-Parchim – Vermessung und Geoinformation","Landkreis Mecklenburgische Seenplatte – Zentrale Dienste","Landkreis Nordwestmecklenburg – Kataster und Vermessung","Landkreis Rostock – Kataster- und Vermessungsamt","Landkreis Vorpommern-Greifswald – Kataster- und Vermessungsamt","Landkreis Vorpommern-Rügen – Kataster und Vermessung"}', '{"Udo Harms","Manuel Schulz","Martin Zielke","Frank Holzapfel","Holger Riedel","Andreas Wirsing","Ronald Günther"}', '{udo.harms@rostock.de,manuel.schulz@kreis-lup.de,martin.zielke@lk-seenplatte.de,f.holzapfel@nordwestmecklenburg.de,holger.riedel@lkros.de,andreas.wirsing@kreis-vg.de,ronald.guenther@lk-vr.de}', NULL, false, NULL);
INSERT INTO links (id, parent_id, category, category_order, "group", group_order, title, link, public, description, date, authorship_organisation, authorship_name, authorship_mail, logo, search, search_title) VALUES (893, 893, 'geoservice', 5, 'WFS', 7, 'Baustellen (geplant) in der Hanse- und Universitätsstadt Rostock und Umgebung', 'https://geo.sv.rostock.de/geodienste/baustellen_geplant/wfs', true, 'Diese Daten umfassen die geplanten Baustellen in der Hanse- und Universitätsstadt Rostock und Umgebung mit Informationen zu Straße, Projektbezeichnung, Bezeichnung, Kurzbeschreibung, Lagebeschreibung, verkehrlichen Lagen, Sparten, Beginn der Baumaßnahmen, Ende der Baumaßnahmen, Auftraggeber, Ansprechpartner und Status.', '2020-10-23', '{"Hanse- und Universitätsstadt Rostock – Tiefbauamt","Stadtwerke Rostock AG"}', '{"Thomas Kienapfel","Suzanne Brandner"}', '{thomas.kienapfel@rostock.de,suzanne.brandner@swrag.de}', NULL, true, NULL);
