INSERT INTO links (id, parent_id, category, category_order, "group", group_order, title, link, public, description, date, authorship_organisation, authorship_name, authorship_mail, logo, search, search_title) VALUES (1017, 1016, 'geoservice', 5, 'WMS', 8, 'Luftqualität der Hanse- und Universitätsstadt Rostock', 'https://geo.sv.rostock.de/geodienste/luftqualitaet/wms', true, 'Diese Karte umfasst Daten zur Luftqualität der Hanse- und Universitätsstadt Rostock. Gezeigt werden Jahresmittelwerte der Immissionsbelastung der Luftschadstoffkomponenten Stickstoffdioxid, Feinstaub und Schwefeldioxid. Eingegangen sind die Emissionen aus genehmigungsbedürftigen Anlagen sowie dem Schiffs- und Straßenverkehr inklusive der Hintergrundbelastung. Die Emissionen wurden im Strömungsfeld der Klimaanalyse, das hierfür auf eine jahresmittlere Ausbreitungssituation erweitert wurde, verdriftet. Hinweis: Die Schadstoffbelastung wird im Rahmen der eingesetzten Methodik hauptsächlich durch die Emissionsmenge und die modellierte Strömung bestimmt. Da hierbei anders als bei der Klimaanalyse keine autochthonen Wetterlage sondern eine jahresdurchschnittliche Ausbreitungssituation im Vordergrund steht, sind die Ergebnisse nur in gewissen Grenzen dazu geeignet, grenzwertrelevante Aussagen im Sinne der 39. BImSchV zu treffen. Rasterauflösung: 20 m.', '2020-08-18', '{"GEO-NET Umweltconsulting GmbH","GEO-NET Umweltconsulting GmbH"}', '{"Peter Trute","Harald Kuttig"}', '{trute@geo-net.de,kuttig@geo-net.de}', NULL, false, NULL);
INSERT INTO links (id, parent_id, category, category_order, "group", group_order, title, link, public, description, date, authorship_organisation, authorship_name, authorship_mail, logo, search, search_title) VALUES (776, 491, 'geoservice', 5, 'WMS', 8, 'Unfallstatistik in der Hanse- und Universitätsstadt Rostock und Umgebung', 'https://geo.sv.rostock.de/geodienste/unfallstatistik/wms', false, 'Diese Karte umfasst die Unfallstatistik in der Hanse- und Universitätsstadt Rostock und Umgebung mit Informationen zu Straße, Unfallart, Unfallkategorie, Kollisionsart, Zeitpunkt, Beteiligten, Personenschäden, Sachschäden, Verkehrsmitteln und Begleitumständen.', '2020-10-09', '{"Polizeiinspektion Rostock"}', '{"Rudolf Lazar"}', '{rudolf.lazar@polmv.de}', NULL, false, NULL);
