INSERT INTO links (id, parent_id, category, category_order, "group", group_order, title, link, public, description, date, authorship_organisation, authorship_name, authorship_mail, logo, search, search_title) VALUES (1009, 1009, 'geoservice', 5, 'WFS', 7, 'Planungshinweiskarten „Klimawirkung (Nacht)“ und „Aufenthaltsqualität (Tag)“ der Hanse- und Universitätsstadt Rostock', 'https://geo.sv.rostock.de/geodienste/klimaplanungshinweise/wfs', false, 'Diese Daten umfassen die Planungshinweiskarten „Klimawirkung (Nacht)“ und „Aufenthaltsqualität (Tag)“ der Hanse- und Universitätsstadt Rostock, basierend auf der Klimaanalysekarte der Hanse- und Universitätsstadt Rostock 2020. Innerstädtische und siedlungsnahe Grünflächen haben eine wesentliche Wirkung auf das Klimawirkung (Nacht) und beeinflussen die direkte Umgebung in mikroklimatischer Sicht positiv. Die Planungshinweiskarten „Klimawirkung (Nacht)“ und „Aufenthaltsqualität (Tag)“ stellen eine integrierende Bewertung der modellierten Klimaparameter im Hinblick auf planungsrelevante Belange dar.', '2020-06-26', '{"GEO-NET Umweltconsulting GmbH","GEO-NET Umweltconsulting GmbH"}', '{"Peter Trute","Dirk Funk"}', '{trute@geo-net.de,funk@geo-net.de}', NULL, true, NULL);
