INSERT INTO links (id, parent_id, category, category_order, "group", group_order, title, link, public, description, date, authorship_organisation, authorship_name, authorship_mail, logo, search, search_title) VALUES (274, 274, 'geoservice', 5, 'WFS', 7, 'Abwärmepotential in der Hanse- und Universitätsstadt Rostock', 'https://geo.sv.rostock.de/geodienste/abwaermepotential/wfs', false, 'Diese Daten umfassen das Abwärmepotential eines jeden einzelnen Gebäudes in der Hanse- und Universitätsstadt Rostock mit Informationen zu Gebäudetyp, Sanierungsstand, Baualtersklasse, Baujahr, Anzahl der Vollgeschosse, Traufhöhe in der Einheit Meter, Nutzfläche in der Einheit Quadratmeter, Versorgungsart, beheiztem Gebäudevolumen in der Einheit Kubikmeter, beheizter Wohnfläche nach EnEV 2009 in der Einheit Quadratmeter, Abwärmepotential aus Raumwärme und Warmwasser Ist-Zustand in der Einheit Kilowattstunden je Jahr, Abwärmepotential aus Prozesswärme Ist-Zustand in der Einheit Kilowattstunden je Jahr und Gesamtabwärmepotential Ist-Zustand in der Einheit Kilowattstunden je Jahr.', '2015-04-21', '{"Hanse- und Universitätsstadt Rostock – Amt für Umwelt- und Klimaschutz"}', '{"Andrea Arnim"}', '{andrea.arnim@rostock.de}', NULL, true, NULL);
