INSERT INTO links (id, parent_id, category, category_order, "group", group_order, title, link, public, description, date, authorship_organisation, authorship_name, authorship_mail, logo, search, search_title) VALUES (984, 984, 'geoservice', 5, 'WFS', 7, 'Hinweise aus Bürgerforen 2019 zu Innenentwicklungspotenzialen in der Hanse- und Universitätsstadt Rostock', 'https://geo.sv.rostock.de/geodienste/hinweise_buergerforen_innenentwicklung_2019/wfs', true, 'Diese Daten umfassen die im Rahmen von Bürgerforen im November 2019 abgegebenen Hinweise zu Innenentwicklungspotenzialen in der Hanse- und Universitätsstadt Rostock mit Informationen zu Art, Verortung und Themen. Der Inhalt stellt keine Bewertung der Hinweise dar, sondern dient ausschließlich deren Dokumentation und Verortung. Eine Bewertung und ein inhaltlicher Abgleich mit anderen Fachkonzepten erfolgt 2020, woran eine weitere Diskussion auf Stadtbereichsebene anschließt. Weitere Informationen erhalten Sie unter: https://zukunftsplan-rostock.de.', '2020-02-14', '{"Hanse- und Universitätsstadt Rostock – Amt für Stadtentwicklung, Stadtplanung und Wirtschaft"}', '{"Oliver Köppen"}', '{oliver.koeppen@rostock.de}', NULL, true, NULL);
