INSERT INTO links (id, parent_id, category, category_order, "group", group_order, title, link, public, description, date, authorship_organisation, authorship_name, authorship_mail, logo, search, search_title) VALUES (1003, 1003, 'geoservice', 5, 'WFS', 7, 'Vorprüfungen der Hanse- und Universitätsstadt Rostock zur Feststellung der UVP-Pflicht gemäß UVPG und LUVPG M-V', 'https://geo.sv.rostock.de/geodienste/uvp_vorpruefungen/wfs', false, 'Diese Daten umfassen die Vorprüfungen der Hanse- und Universitätsstadt Rostock zur Feststellung der Pflicht zur Umweltverträglichkeitsprüfung (UVP-Pflicht) gemäß Gesetz über die Umweltverträglichkeitsprüfung (UVPG) und Gesetz über die Umweltverträglichkeitsprüfung in Mecklenburg-Vorpommern (LUVPG M-V) mit Informationen zu Bezeichnung des Vorhabens, Vorgangsart des Vorhabens, Genehmigungsbehörde des Vorhabens, Datum des Posteingangs bei der Genehmigungsbehörde des Vorhabens, Registriernummer des Bauamtes des Vorhabens, Aktenzeichen des Vorhabens, Rechtsgrundlage des Vorhabens, Typ des Vorhabens, Art, Datum des Posteingangs, Datum, Ergebnis, Datum Bekanntmachung „Städtischer Anzeiger“, Datum Veröffentlichung UVP-Portal und Prüfprotokoll. Umweltprüfungen im Rahmen der Bauleitplanung sind dabei nicht enthalten. Diese werden durch die Umweltberichte im Rahmen der rechtskräftigen Bebauungspläne (B-Pläne) der Hanse- und Universitätsstadt Rostock gemäß §§ 34 und 35 Baugesetzbuch (BauGB) dokumentiert. Die Ergebnisse der Vorprüfungen werden im „Städtischen Anzeiger“ öffentlich bekannt gemacht und seit 2019 auch über das UVP-Portal des Landes Mecklenburg-Vorpommern: https://www.uvp-verbund.de.', '2020-10-02', '{"Hanse- und Universitätsstadt Rostock – Amt für Umwelt- und Klimaschutz"}', '{"Jacqueline Sambale"}', '{jacqueline.sambale@rostock.de}', NULL, true, NULL);
INSERT INTO links (id, parent_id, category, category_order, "group", group_order, title, link, public, description, date, authorship_organisation, authorship_name, authorship_mail, logo, search, search_title) VALUES (171, 416, 'geoservice', 4, 'INSPIRE View Service', 3, 'Landtagswahl 2006 in der Hanse- und Universitätsstadt Rostock', 'https://geo.sv.rostock.de/geodienste/landtagswahl_2006/wms', true, 'Diese Karte umfasst die Standorte der Wahllokale der Landtagswahl 2006 in der Hanse- und Universitätsstadt Rostock vom 17.09.2006 mit Informationen zu Wahlbezirksnummer(n) sowie die Wahlbezirke der Landtagswahl 2006 in der Hanse- und Universitätsstadt Rostock vom 17.09.2006 mit Informationen zu Nummer.', '2017-03-15', '{"Hanse- und Universitätsstadt Rostock – Hauptamt"}', '{"Petra Guljam"}', '{petra.guljam@rostock.de}', NULL, false, NULL);
